from IPython.display import display, Markdown



def inicio():
    display(Markdown("<img src='data:image/jpeg;base64,'>"))

bold_start = '\033[1m'
bold_end   = '\033[0m'

import platform
import time

def configuracion():
	print(bold_start, 'SYSTEM: ', bold_end, platform.system())
	print(bold_start, 'VERSION: ', bold_end, platform.version())
	print(bold_start, 'MACHINE: ', bold_end, platform.machine())
	print(bold_start, 'PROCESSOR: ', bold_end, platform.processor())
	print(bold_start, 'VERSION PYTHON: ', bold_end, platform.python_version())
	print(bold_start, 'COMPILER: ', bold_end, platform.python_compiler())
	print(bold_start, 'ALIASED: ', bold_end, platform.platform(aliased=True))
	print(bold_start, 'TERSE: ', bold_end, platform.platform(terse=True))
	print(bold_start, 'INTERPRETER: ', bold_end, platform.architecture())

def fin():
	display(Markdown("<img src='data:image/png;base64,'>"))

time.sleep(0.3)
inicio()
time.sleep(0.3)
configuracion()
time.sleep(0.1)
fin()


